(4, 'Vung Tau', 'vung-tau', 'upload/images/Untitled.png', 'Name: Vung Tau\r\nPopulation: 1.041.565\r\nDistance: 140 KM\r\nOperator: Hoa Mai, Phuong Trang, Mai Linh\r\nPrice : 95.000 – 110.000 VND\r\nSee: \r\n-         Thang Tam Temple\r\n-         Martr’s Memorial\r\n-         Statue of Jesus Christ with outstretched arms\r\n-         Villa Blanche', 'Vung Tau is the tourist and commercial center of B&agrave; Rịa - Vũng T&agrave;u (an industrial province in Southeastern Vietnam). The whole city area lies on a peninsula which is separated from the mainland by a gulf river called Co May river.<br />\r\n&nbsp;<br />\r\nLocated in Southern Vietnam, Vũng T&agrave;u has only two seasons in a year :<br />\r\nDry season (November - April) : dry&nbsp;and slightly cooler during winter months and around Tết Holiday. Gets hotter in April.<br />\r\n&nbsp;<br />\r\nRainy season (May -&nbsp;October) : rainy, but less than Ho Chi Minh City. Usually hot at noon till 3PM. Summer is&nbsp;ideal for sea bathing.<br />\r\n&nbsp;<br />\r\nH&igrave;nh ảnh:<br />\r\n<br />\r\n<img alt="" src="../upload/images/Untitled.png" style="width: 500px; height: 300px;" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, 0, 2, 1409284558, 1409284582, 0, 14),
(5, 'Da Nang', 'da-nang', 'upload/images/da-nang.jpg', 'Name: Da Nang\r\nPopulation: 942.132\r\nDistance: 611 KM\r\nOperator: Mai Linh, Phương Trang, Hạnh café, Hoàng Long\r\nPrice : 435.000 đ – 520.000 đ\r\nSee: \r\n-       My Khe Beach\r\n-       Ba Na Hill Station\r\n-       Cham Island\r\n-       Cham Museum\r\n-       Marble Mountains', 'Da Nang (Đ&agrave; Nẵng) is Vietnam&#39;s third largest city, and is located on the Eastern Sea coast, midway between Hanoi and Ho Chi Minh City and the largest city of Central Vietnam.<br />\r\n&nbsp;<br />\r\nThe city itself has neither the atmosphere of Hanoi nor the hustle-bustle of Ho Chi Minh City, but has its share of sights and is close to the charms of Hoi An and the imperial capital of Hue, making it a popular vacationing spot for those looking to explore the attractions of central Vietnam or soak up some rays while hanging out on the city&#39;s beaches.<br />\r\n&nbsp;<br />\r\nThe hottest months of the year are June, July, and August, when the temperature can get to as high as 40 degrees Celsius, and it is generally very dry. There are usually tropical storms in October and November.<br />\r\n&nbsp;<img alt="" src="../upload/images/dan.png" style="width: 1600px; height: 1002px;" /><br />\r\n', 1, 0, 2, 1409285142, 1409285142, 0, 14),
(6, 'Xách ba-lô lên và... bỏ xuống!', 'xach-ba-lo-len-va-bo-xuong!', 'upload/files/never_give_up.jpg', 'Và có những khoảng thời gian, tui luôn phải tự dằn lòng, mỗi lần xách ba-lô lên và buồn bã bỏ xuống...', 'Thỉnh thoảng tui vẫn gh&eacute;t c&aacute;i cảm gi&aacute;c n&agrave;y, dường như năm nay l&agrave; một năm đại thất bại trong mọi thứ, kể cả việc đi long rong m&agrave; trước kia tưởng chừng đơn giản như một c&uacute; nhảy xe bu&yacute;t nhẹ tưng, mỗi khi xe trờ đến trạm dừng. Vậy m&agrave; cho tới giờ n&agrave;y, &iacute;t nhất l&agrave; 2 chuyến h&agrave;nh tr&igrave;nh đ&atilde; lở dở, bỏ lại sau lưng những tiếc nuối tr&ugrave;ng v&acirc;y...<br />\r\n<br />\r\nTui vẫn hay lẩm nhẩm trong bụng v&agrave; với bạn b&egrave;: &quot;qu&aacute; nhiều kỳ vọng, nhưng qu&aacute; &iacute;t sự lựa chọn&quot;; v&agrave; &quot;nếu kh&ocirc;ng chọn được cho m&igrave;nh thứ tốt nhất, th&igrave; h&atilde;y chọn thứ ph&ugrave; hợp với những người xung quanh&quot;. Ừ, những-người-xung-quanh, suy cho c&ugrave;ng, một c&aacute; thể kh&ocirc;ng thể tồn tại trong c&aacute;i x&atilde; hội khắc nghiệt n&agrave;y nếu chẳng c&oacute; những mối li&ecirc;n hệ, chằng chịt như đường d&acirc;y cao thế giăng mắc từ Bắc v&ocirc; Nam... V&agrave;i h&ocirc;m trước c&oacute; nhắc chuyện đi bụi với một chị đ&atilde;-dừng-bước-giang-hồ, chị ấy bảo: &quot;Ng&agrave;y xưa nghĩ cũng liều thật, lướt v&egrave;o v&egrave;o l&ecirc;n đ&egrave;o xuống dốc, chả nghĩ ngợi g&igrave;, nhưng giờ c&oacute; cho v&agrave;ng chị chẳng d&aacute;m đi nữa! Đ&ugrave;a chứ nhỡ m&igrave;nh c&oacute; việc g&igrave; th&igrave; con m&igrave;nh ở nh&agrave; ra sao?!&quot;. Ừ nhỉ, con m&igrave;nh ở nh&agrave; ra sao?! Hay bố mẹ m&igrave;nh sẽ ra sao nếu nhỡ chẳng may m&igrave;nh c&oacute; chuyện g&igrave; đ&oacute; bất khả kh&aacute;ng!? Cuối c&ugrave;ng th&igrave; m&igrave;nh c&oacute; bao nhi&ecirc;u m&oacute;n nợ vay những &acirc;n t&igrave;nh?! Bao nhi&ecirc;u khoản phải trả lại cho con c&aacute;i sau n&agrave;y, v&agrave; bao nhi&ecirc;u khoản sẽ c&ograve;n m&atilde;i theo năm th&aacute;ng!?...<br />\r\n<br />\r\n<img alt="" src="../upload/images/tin-tuc/never_give_up.jpg" style="width: 400px; height: 300px;" /><br />\r\n<br />\r\nNhưng vạn sự tr&ecirc;n đời chẳng qua cũng xoay quanh mỗi chữ &quot;Duy&ecirc;n&quot;, v&agrave; n&oacute;i như kiểu người Ấn: &quot;sự việc xảy đến, hiển nhi&ecirc;n n&oacute; sẽ đến&quot;, nghĩa l&agrave; chẳng ai c&oacute; thể nghịch chuyển được số phận v&agrave; vận mệnh của m&igrave;nh, &quot;bắt phong trần phải phong trần, cho thanh cao mới được phần thanh cao&quot;. V&agrave; ch&uacute;t duy&ecirc;n hờ của tui với những m&oacute;n ăn chơi, s&acirc;n si c&ugrave;ng những cung đường, c&ugrave;ng c&aacute;i ba-l&ocirc; sau lưng hay c&aacute;i m&aacute;y ảnh bật tưng tưng trước ngực, đến bao giờ kết th&uacute;c kh&oacute; m&agrave; n&oacute;i được... Chỉ biết l&agrave; mọi thứ phải được c&acirc;n bằng! Con đường đang đi sẽ phải tiếp tục đi, cho d&ugrave; phải thụt l&ugrave;i v&agrave;i bước thật d&agrave;i... Trong chừng mực n&agrave;o đ&oacute;, ch&uacute;ng ta được quyền tự l&agrave;m tổn thương bản th&acirc;n, nhưng h&atilde;y đừng l&agrave;m tổn thương những người đ&atilde; v&agrave; đang quan t&acirc;m đến từng bước ch&acirc;n ch&uacute;ng ta đang đi! Bởi v&igrave;, một c&aacute; thể trong x&atilde; hội, cũng như một tế b&agrave;o trong cơ thể, sẽ chẳng bao giờ tồn tại nổi một c&aacute;ch đơn lẻ...<br />\r\n<br />\r\nV&agrave; c&oacute; những khoảng thời gian, tui lu&ocirc;n phải tự dằn l&ograve;ng, mỗi lần x&aacute;ch ba-l&ocirc; l&ecirc;n v&agrave; buồn b&atilde; bỏ xuống... Ch&uacute;ng ta chỉ c&oacute; mỗi một cuộc đời, v&agrave; cuộc đời đ&oacute;, kh&ocirc;ng chỉ sống v&igrave; bản th&acirc;n ta!?', 1, 0, 1, 1409764158, 1409764158, 1, 14),
(7, 'Người đưa thư', 'nguoi-dua-thu', 'upload/images/A_mailman_525_525.jpg', 'Chợt nhận ra trên tay là một phong thư niêm kín, đề từ: "Gửi người vẽ tranh trong thảo lư giữa rừng mai trắng phương Bắc". Người gượng dậy, cất bước lên đường...', 'Đường về phương Bắc trải d&agrave;i vạn dặm, mặc thời gian mỏi m&ograve;n phai bạc m&agrave;u t&oacute;c, c&aacute;t bụi dặm trường phủ k&iacute;n lần &aacute;o pon-s&ocirc;, g&oacute;t giầy tả tơi l&ecirc; qua bao m&ugrave;a phong sương, kh&aacute;ch lạ vẫn kh&ocirc;ng ngoảnh mặt, c&uacute;i đầu m&agrave; đi.<br />\r\n<br />\r\nĐ&ecirc;m mưa, gi&oacute; buốt, thấy m&igrave;nh giữa bốn ng&atilde; rẽ đường xa, băn khoăn kh&ocirc;ng biết đi về đ&acirc;u, chợt thấy c&oacute; d&aacute;ng người phủ phục b&ecirc;n bếp lửa hắt hiu giữa t&uacute;p lều t&agrave;n. Nghe tiếng bước ch&acirc;n, người kia gượng dậy:<br />\r\n<br />\r\n- C&oacute; phải l&agrave; Huyền Vũ đang tr&ecirc;n đường về phương Bắc?<br />\r\n<br />\r\n- Chẳng phải người l&agrave; Thanh Long, đ&atilde; hạnh ngộ ở tửu điếm năm xưa?<br />\r\n<br />\r\n- L&agrave; tại hạ, lạc bước đường xa, gối mỏi ch&acirc;n m&ograve;n, lại đang cần gửi một phong thư về phương Đ&ocirc;ng. Người c&oacute; khi n&agrave;o độ đường phương đ&oacute;, xin chuyển gi&uacute;p thư n&agrave;y tới thảo lư b&ecirc;n dưới rặng t&ugrave;ng trong tiết xu&acirc;n.<br />\r\n<br />\r\nKh&aacute;ch lạ nhận lời, mang theo phong thư đi về hướng ngọn gi&oacute; xu&acirc;n mơn man thổi về. Đường xa kh&ocirc;ng quản, thời gian kh&ocirc;ng ngừng, lần hồi người cũng tới m&aacute;i lều cỏ dưới rặng t&ugrave;ng, thấy c&oacute; người ca kỹ đang ngồi c&acirc;m n&iacute;n b&ecirc;n đ&agrave;n. Ra l&agrave; n&agrave;ng Cầm, đang mỏi mắt chờ tin Thanh Long. Nhận thư, n&agrave;ng b&aacute;i tạ, rồi đ&agrave;n l&ecirc;n một kh&uacute;c nhạc xu&acirc;n rộn r&agrave;ng xao xuyến. Tiếng đ&agrave;n văng vẳng ng&acirc;n l&ecirc;n như từ c&otilde;i thi&ecirc;n thai, tiễn bước người tiếp tục l&ecirc;n đường.<br />\r\n<br />\r\nĐ&ecirc;m mưa, gi&oacute; buốt, lại thấy m&igrave;nh giữa bốn ng&atilde; rẽ đường xa, băn khoăn kh&ocirc;ng biết đi về đ&acirc;u, chợt thấy c&oacute; d&aacute;ng người phủ phục b&ecirc;n bếp lửa hắt hiu giữa t&uacute;p lều t&agrave;n. Nghe tiếng bước ch&acirc;n, người kia gượng dậy:<br />\r\n<br />\r\n- C&oacute; phải l&agrave; Huyền Vũ đang tr&ecirc;n đường về phương Bắc?<br />\r\n<br />\r\n- Chẳng phải người l&agrave; Bạch Hổ, đ&atilde; hạnh ngộ ở tửu điếm năm xưa?<br />\r\n<br />\r\n- L&agrave; tại hạ, lạc bước đường xa, gối mỏi ch&acirc;n m&ograve;n, lại đang cần gửi một phong thư về phương T&acirc;y. Người c&oacute; khi n&agrave;o độ đường phương đ&oacute;, xin chuyển gi&uacute;p thư n&agrave;y tới thảo lư b&ecirc;n dưới rừng tr&uacute;c trong tiết hạ.<br />\r\n<br />\r\nKh&aacute;ch lạ nhận lời, mang theo phong thư đi về hướng ngọn gi&oacute; hạ rực nắng thổi về. Đường xa kh&ocirc;ng quản, thời gian kh&ocirc;ng ngừng, lần hồi người cũng tới m&aacute;i lều cỏ dưới rừng tr&uacute;c, thấy c&oacute; người đang ngồi c&acirc;m n&iacute;n b&ecirc;n cờ thế. Ra l&agrave; n&agrave;ng Kỳ, đang mỏi mắt chờ tin Bạch Hổ. Nhận thư, n&agrave;ng b&aacute;i tạ, rồi đưa tay đẩy thế cờ xoay chuyển. Động t&aacute;c huyền ảo như vũ c&ocirc;ng, c&ograve;n chập chờn trước mắt người đi. Đ&ecirc;m mưa, gi&oacute; buốt, lại thấy m&igrave;nh giữa bốn ng&atilde; rẽ đường xa, băn khoăn kh&ocirc;ng biết đi về đ&acirc;u, chợt thấy c&oacute; d&aacute;ng người phủ phục b&ecirc;n bếp lửa hắt hiu giữa t&uacute;p lều t&agrave;n. Nghe tiếng bước ch&acirc;n, người kia gượng dậy:<br />\r\n<br />\r\n- C&oacute; phải l&agrave; Huyền Vũ đang tr&ecirc;n đường về phương Bắc?<br />\r\n<br />\r\n- Chẳng phải người l&agrave; Chu Tước, đ&atilde; hạnh ngộ ở tửu điếm năm xưa?<br />\r\n<br />\r\n- L&agrave; tại hạ, lạc bước đường xa, gối mỏi ch&acirc;n m&ograve;n, lại đang cần gửi một phong thư về phương Nam. Người c&oacute; khi n&agrave;o độ đường phương đ&oacute;, xin chuyển gi&uacute;p thư n&agrave;y tới thảo lư b&ecirc;n đồi c&uacute;c trong tiết thu.<br />\r\n<br />\r\nKh&aacute;ch lạ nhận lời, mang theo phong thư đi về hướng ngọn gi&oacute; thu dặt d&igrave;u thổi về. Đường xa kh&ocirc;ng quản, thời gian kh&ocirc;ng ngừng, lần hồi người cũng tới m&aacute;i lều cỏ b&ecirc;n đồi c&uacute;c, thấy c&oacute; người đang ngồi c&acirc;m n&iacute;n b&ecirc;n t&agrave;ng thư l&acirc;u. Ra l&agrave; n&agrave;ng Thi, đang mỏi mắt chờ tin Chu Tước. Nhận thư, n&agrave;ng b&aacute;i tạ, rồi nảy l&ecirc;n một kh&uacute;c ng&acirc;m. Văng vẳng như c&oacute; tiếng trống Tr&agrave;ng Th&agrave;nh lung lay trong kh&oacute;i Cam Tuyền mờ mịt tiễn bước người đi.<br />\r\n<br />\r\nĐường xa vạn dặm, chẳng mấy chốc tuyết sương đ&atilde; giăng giăng khắp chốn. Người lại thấy m&igrave;nh lạc lối trần ai, băn khoăn kh&ocirc;ng biết đi về đ&acirc;u, chợt thấy c&oacute; d&aacute;ng người ngồi c&acirc;m n&iacute;n giữa t&uacute;p lều t&agrave;n giữa rừng mai trắng, b&ecirc;n cạnh l&agrave; tấm toan cũng một m&agrave;u trắng muốt. Kh&aacute;ch lạ cất tiếng:<br />\r\n<br />\r\n- D&aacute;m hỏi qu&yacute; danh người ngồi b&ecirc;n mai?<br />\r\n<br />\r\n- L&agrave; phận hồng quần tr&oacute;t theo lời hẹn ước với thời gian, đang chờ tin người mải phi&ecirc;u bạt giang hồ, về gh&eacute; qua chốn đ&acirc;y để vẽ xong bức họa h&agrave;nh tr&igrave;nh trước khi người trả phận m&igrave;nh cho Hư V&ocirc;.<br />\r\n<br />\r\n- Người đ&oacute; l&agrave; ai? Kh&aacute;ch lạ chưa kịp nghe lời đ&aacute;p, chỉ thấy lạnh buốt thịt da, tỉnh ra thấy m&igrave;nh đang phủ phục b&ecirc;n bếp lửa hắt hiu giữa t&uacute;p lều t&agrave;n, bốn bề xung quanh mịt mờ sương kh&oacute;i, gối mỏi ch&acirc;n m&ograve;n...<br />\r\n<br />\r\nChợt nhận ra tr&ecirc;n tay l&agrave; một phong thư ni&ecirc;m k&iacute;n, đề từ: &quot;Gửi người vẽ tranh trong thảo lư giữa rừng mai trắng phương Bắc&quot;.<br />\r\n<br />\r\nNgười gượng dậy, cất bước l&ecirc;n đường...', 1, 0, 1, 1409764611, 1409764611, 1, 14);
