(19, 'Mai Linh', 'mai-linh', 'Mai Linh', 'mai-linh', '64 - 68 Hai Ba Trung, Ben Nghe Ward, Dist 1, HCMC', '64 - 68 Hai Ba Trung St, Ben Nghe Ward, Dist 1, HCMC', '08.38 29 8888', 'Công Ty Cổ Phần Vận Tải Tốc Hành Mai Linh - Mai Linh Express có hơn 500 xe hoạt động trên 49 tuyến đường xe khách Bắc Nam nối liền trên 24 tỉnh thành. Với phương châm “xe khởi hành đúng giờ - không khói thuốc – không đón khách dọc đường”, cùng với phong cách phục vụ chuyên nghiệp, tận tình, chu đáo và trung thực, đến nay hình ảnh xe khách chất lượng cao Mai Linh đã trở nên quen thuộc với khách hàng. Xe Mai Linh đang nỗ lực từng ngày, từng giờ, tiến dần đến mục tiêu phục vụ hành khách với chất lượng ngang tầm khu vực và đạt chuẩn quốc tế. Mai Linh - An toàn, chất lượng, mọi lúc, mọi nơi.', 'Công Ty Cổ Phần Vận Tải Tốc Hành Mai Linh - Mai Linh Express có hơn 500 xe hoạt động trên 49 tuyến đường xe khách Bắc Nam nối liền trên 24 tỉnh thành. Với phương châm “xe khởi hành đúng giờ - không khói thuốc – không đón khách dọc đường”, cùng với phong cách phục vụ chuyên nghiệp, tận tình, chu đáo và trung thực, đến nay hình ảnh xe khách chất lượng cao Mai Linh đã trở nên quen thuộc với khách hàng. Xe Mai Linh đang nỗ lực từng ngày, từng giờ, tiến dần đến mục tiêu phục vụ hành khách với chất lượng ngang tầm khu vực và đạt chuẩn quốc tế. Mai Linh - An toàn, chất lượng, mọi lúc, mọi nơi.', 'upload/images/nha-xe/Logo%20Mai%20Linh.png', 1407311754, 1409279373, 1, 1, 13),
(20, 'TheSinh Tourist', 'thesinh-tourist', 'TheSinh Tourist', 'thesinh-tourist', '246 - 248 Đề Thám, Quận 1, TP.Hồ Chí Minh', '246 - 248 De Tham St, Pham Ngu Lao Ward, Dist 1, HCMC', '08 3838 9597', 'Được thành lập năm 1993, hãng xe TheSinhTourist (tiền thân là Sinh Café) đã không ngừng phát triển và hiện nay là một trong những công ty lữ hành hàng đầu Việt Nam. Điểm nổi bật nhất ở nhà xe The Sinh Tourist là các chuyến đi khởi hành hàng ngày và không phụ thuộc vào số lượng khách. Cùng với việc khai trương hai khách sạn ở Campuchia, cũng như đưa vào hệ thống xe buýt chạy thẳng Sài Gòn – Phnom Penh – Siêm Riệp, nhà xe TheSinhTourist đang nỗ lực hết mình để trở thành một trong những công ty lữ hành hàng đầu Đông Nam Á. Lấy niềm vui khách hàng là niềm vui của mình: The Sinh Tourist thật sự hạnh phúc khi cảm nhận được sự hài lòng và nhìn thấy nụ cười của quý khách.', 'Được thành lập năm 1993, hãng xe TheSinhTourist (tiền thân là Sinh Café) đã không ngừng phát triển và hiện nay là một trong những công ty lữ hành hàng đầu Việt Nam. Điểm nổi bật nhất ở nhà xe The Sinh Tourist là các chuyến đi khởi hành hàng ngày và không phụ thuộc vào số lượng khách. Cùng với việc khai trương hai khách sạn ở Campuchia, cũng như đưa vào hệ thống xe buýt chạy thẳng Sài Gòn – Phnom Penh – Siêm Riệp, nhà xe TheSinhTourist đang nỗ lực hết mình để trở thành một trong những công ty lữ hành hàng đầu Đông Nam Á. Lấy niềm vui khách hàng là niềm vui của mình: The Sinh Tourist thật sự hạnh phúc khi cảm nhận được sự hài lòng và nhìn thấy nụ cười của quý khách.', 'upload/images/nha-xe/imgres.jpg', 1407311964, 1409279396, 0, 1, 13),
(21, 'Phương Nam', 'phuong-nam', 'Phương Nam', 'phuong-nam', '275E Phạm Ngũ Lão, P. Phạm Ngũ Lão, Quận 1, TP.Hồ Chí Minh', '275E Pham Ngu Lao St, Pham Ngu Lao Ward, Dist 1, HCMC', '3836 4086', 'Với xe chất lượng cao, Hãng xe PHƯƠNG NAM (PHƯƠNG NAM EXPRESS) được ra đời nhằm đáp ứng nhu cầu về du lịch lữ hành, đi lại, tour, đặc biệt là trên tuyến đường hướng về thành phố Nha Trang và khu vực miền Trung. Nhà xe PHƯƠNG NAM luôn nỗ lực cung cấp cho hành khách dịch vụ chuyên nghiệp và tận tình nhất. Xe có đầy đủ các tiện ích như tivi màn hình phẳng, toilet được dọn dẹp thường xuyên và sạch sẽ. Đội ngũ lái xe và nhân viên phục vụ được huấn luyện kỹ càng vì quan niệm: ‘AN TOÀN LÀ TRÊN HẾT’ Hãng xe PHƯƠNG NAM EXPRESS còn cung cấp các loại hình tour du lịch ở các thành phố du lịch nổi tiếng như: Nha Trang, Huế, Hội An, Đà Nẵng. Nhà xe cũng hỗ trợ đặt phòng khách sạn, resort, tìm kiếm tour du lịch phù hợp khi du khách có cần trợ giúp.', 'Với xe chất lượng cao, Hãng xe PHƯƠNG NAM (PHƯƠNG NAM EXPRESS) được ra đời nhằm đáp ứng nhu cầu về du lịch lữ hành, đi lại, tour, đặc biệt là trên tuyến đường hướng về thành phố Nha Trang và khu vực miền Trung. Nhà xe PHƯƠNG NAM luôn nỗ lực cung cấp cho hành khách dịch vụ chuyên nghiệp và tận tình nhất. Xe có đầy đủ các tiện ích như tivi màn hình phẳng, toilet được dọn dẹp thường xuyên và sạch sẽ. Đội ngũ lái xe và nhân viên phục vụ được huấn luyện kỹ càng vì quan niệm: ‘AN TOÀN LÀ TRÊN HẾT’ Hãng xe PHƯƠNG NAM EXPRESS còn cung cấp các loại hình tour du lịch ở các thành phố du lịch nổi tiếng như: Nha Trang, Huế, Hội An, Đà Nẵng. Nhà xe cũng hỗ trợ đặt phòng khách sạn, resort, tìm kiếm tour du lịch phù hợp khi du khách có cần trợ giúp.', 'upload/images/nha-xe/Untitled.png', 1407312189, 1409279405, 1, 1, 13),
