(23, 'Phương Trang', 'phuong-trang', 'Phương Trang', 'phuong-trang', '486 - 486A Lê Văn Lương, P. Tân Phong, Q 7, TP Hồ Chí Minh', '486 -486A Le Van Luong St, Tan Phong Ward, Dist 7, HCMC', '0838 386 852', 'Mang một phong cách nổi bật và hiện đại, màu cam của xe Phương Trang (còn gọi là Futatrans hoặc Futa Phương Trang) đã ghi lại dấu ấn tốt đẹp trong lòng hành khách trong suốt 11 năm hình thành và phát triển. Xe giường nằm cao cấp Phương Trang hoạt động từ từ Huế và Đà Nẵng đổ vào đến hầu hết các tỉnh miền Tây nhằm phục vụ tối đa nhu cầu đi lại của hành khách. Sự phục vụ lịch thiệp và chu đáo của đội ngũ nhân viên đã giúp xe khách Phương Trang trở thành một địa chỉ tin cậy nhất của đông đảo khách hàng trong và ngoài nước. Phương Trang – Chất lượng là danh dự', 'Mang một phong cách nổi bật và hiện đại, màu cam của xe Phương Trang (còn gọi là Futatrans hoặc Futa Phương Trang) đã ghi lại dấu ấn tốt đẹp trong lòng hành khách trong suốt 11 năm hình thành và phát triển. Xe giường nằm cao cấp Phương Trang hoạt động từ từ Huế và Đà Nẵng đổ vào đến hầu hết các tỉnh miền Tây nhằm phục vụ tối đa nhu cầu đi lại của hành khách. Sự phục vụ lịch thiệp và chu đáo của đội ngũ nhân viên đã giúp xe khách Phương Trang trở thành một địa chỉ tin cậy nhất của đông đảo khách hàng trong và ngoài nước. Phương Trang – Chất lượng là danh dự', 'upload/images/nha-xe/Logo%20Phuongtrang.png', 1407313702, 1409279459, 1, 1, 13),
(24, 'Thuận Thảo', 'thuan-thao', 'Thuận Thảo', 'thuan-thao', '03 Hải Dương - Bình Ngọc - Thành phố Tuy Hòa - Phú Yên', '03 Hai Duong - Binh Ngoc - Tuy Hoa City - Phu Yen Province', '3824 229', 'Hiếm ai biết xe khách Thuận Thảo là hãng xe thành lập bến xe tư nhân Chất lượng cao đầu tiên và duy nhất ở Việt Nam vào thời điểm 2001-2003. Luôn tuân theo tôn chỉ kinh doanh “Uy tín tạo dựng thành công”, xe Thuận Thảo đã đạt được rất nhiều thành tựu, giải thưởng: chứng chỉ ISO, bằng khen của Thủ tướng và các cấp lãnh đạo, Cúp vàng Thương Hiệu Việt, Huân chương Lao động, Cúp vàng thương hiệu Việt, Sao vàng Đất Việt,…nhiều năm liền. Nhà xe Thuận Thảo luôn là nhãn hiệu đặc biệt tin tưởng của người dân Phú Yên và các tỉnh thành gần xa khi có nhu cầu vận chuyển, chuyên chở. Thuận Thảo – Uy tín tạo dựng thành công', 'Hiếm ai biết xe khách Thuận Thảo là hãng xe thành lập Bến xe tư nhân Chất lượng cao đầu tiên và duy nhất ở Việt Nam vào thời điểm 2001-2003. Luôn tuân theo tôn chỉ kinh doanh “Uy tín tạo dựng thành công”, xe Thuận Thảo đã đạt được rất nhiều thành tựu, giải thưởng: chứng chỉ ISO, bằng khen của Thủ tướng và các cấp lãnh đạo, Cúp vàng Thương Hiệu Việt, Huân chương Lao động, Cúp vàng thương hiệu Việt, Sao vàng Đất Việt,…nhiều năm liền. Nhà xe Thuận Thảo luôn là nhãn hiệu đặc biệt tin tưởng của người dân Phú Yên và các tỉnh thành gần xa khi có nhu cầu vận chuyển, chuyên chở. Thuận Thảo – Uy tín tạo dựng thành công', 'upload/images/nha-xe/images-1.jpeg', 1407314003, 1409286304, 0, 1, 14),
