(26, 'Hoàng Long', 'hoang-long', 'Hoàng Long', 'hoang-long', 'Số 05 Phạm Ngũ Lão - P.Lương Khánh Thiện - Q.Ngô Quyền - TP. Hải Phòng', '05 Pham Ngu Lao St, Luong Khanh Thien Ward, Ngo Quyen Dist, Hai Phong City', '0313 920920', 'Hãng xe Hoàng Long hay còn gọi là Hoàng Long Asia hoặc Hoàng Long Bus là một trong những thương hiệu xe chất lượng cao hàng đầu Việt Nam. Phục vụ hàng chục triệu hành khách Việt Nam và quốc tế trong suốt 16 năm hoạt động, xe khách Hoàng Long đã đạt giải thưởng Sao Vàng đất Việt 3 lần liên tiếp. Xe giường nằm cao cấp Hoàng Long liên tục cải tiến với rất nhiều tiện ích như TV, máy lạnh, khăn lạnh, nhà vệ sinh,... giúp hành khách trên xe luôn cảm giác thoải mái. Tất cả các lái phụ xe của nhà xe Hoàng Long đều được học giao tiếp du lịch để luôn đối xử ân cần và lịch sự đối với hành khách. Nhờ những cố gắng không ngừng, danh tiếng của Hoàng Long lan rộng khắp Việt Nam và quốc tế. Hoàng Long - Không ngừng đổi mới, không ngừng nâng cao chất lượng phục vụ.', 'Hãng xe Hoàng Long hay còn gọi là Hoàng Long Asia hoặc Hoàng Long Bus là một trong những thương hiệu xe chất lượng cao hàng đầu Việt Nam. Phục vụ hàng chục triệu hành khách Việt Nam và quốc tế trong suốt 16 năm hoạt động, xe khách Hoàng Long đã đạt giải thưởng Sao Vàng đất Việt 3 lần liên tiếp. Xe giường nằm cao cấp Hoàng Long liên tục cải tiến với rất nhiều tiện ích như TV, máy lạnh, khăn lạnh, nhà vệ sinh,... giúp hành khách trên xe luôn cảm giác thoải mái. Tất cả các lái phụ xe của nhà xe Hoàng Long đều được học giao tiếp du lịch để luôn đối xử ân cần và lịch sự đối với hành khách. Nhờ những cố gắng không ngừng, danh tiếng của Hoàng Long lan rộng khắp Việt Nam và quốc tế. Hoàng Long - Không ngừng đổi mới, không ngừng nâng cao chất lượng phục vụ.', 'upload/images/nha-xe/Logo%20Hoang%20Long.png', 1407314600, 1409279585, 1, 1, 13),
(27, 'Anh Khoa', 'anh-khoa', 'Anh Khoa', 'anh-khoa', '306 Lê Hồng Phong, P.10, Quận 10, TP.Hồ Chí Minh', '306 Le Hong Phong St, Ward 10, Dist 10, HCMC', '08 6650 3399', 'Hãng xe Anh Khoa (Anh Khoa Bus) tập trung vào dịch vụ xe khách tuyến Buôn Ma Thuột- TP HCM, do vậy nhà xe Anh Khoa luôn coi chất lượng phục vụ hành khách là hàng đầu và tạo khác biệt với các nhà xe khác ở sự thân thiện, dễ mến. Hiện tại xe Anh Khoa có dịch vụ xe khách chất lượng cao và chuyển phát hàng hóa luôn được khen ngợi về sự an toàn, thuận tiện, giao nhận dễ dàng. Hiện tại, xe khách Anh Khoa bao gồm cả xe ghế ngồi và xe giường nằm, phục vụ nhiều chuyến một ngày và có xe trung chuyển trong TP HCM.', 'Hãng xe Anh Khoa (Anh Khoa Bus) tập trung vào dịch vụ xe khách tuyến Buôn Ma Thuột- TP HCM, do vậy nhà xe Anh Khoa luôn coi chất lượng phục vụ hành khách là hàng đầu và tạo khác biệt với các nhà xe khác ở sự thân thiện, dễ mến. Hiện tại xe Anh Khoa có dịch vụ xe khách chất lượng cao và chuyển phát hàng hóa luôn được khen ngợi về sự an toàn, thuận tiện, giao nhận dễ dàng. Hiện tại, xe khách Anh Khoa bao gồm cả xe ghế ngồi và xe giường nằm, phục vụ nhiều chuyến một ngày và có xe trung chuyển trong TP HCM.', '', 1407314740, 1409280190, 0, 1, 13),
(28, 'Minh Thắng', 'minh-thang', 'Minh Thắng', 'minh-thang', '306 Lê Hồng Phong, P.10, Quận 10, TP.Hồ Chí Minh', '306 Le Hong Phong St, Ward 10, Dist 10, HCMC', '08 6650 3399', 'Thương hiệu hãng xe Hoa Mai hiện đã trở nên rất quen thuộc với hành khách trên tuyến TP HCM – Vũng Tàu với loại xe 16 chỗ chạy tần suất 10-15 phút/chuyến. Xe khách Hoa Mai có chất lượng phục vụ ổn định, thân thiện, và được nhiều hành khách tin dùng để tham quan, du lịch Vũng Tàu, đặc biệt là các kỳ nghỉ, lễ tết. Nhà xe Hoa Mai tin chắc rằng sự tận tâm phục vụ của mình sẽ làm hài lòng mọi quý khách. thu gọn', 'Thương hiệu hãng xe Hoa Mai hiện đã trở nên rất quen thuộc với hành khách trên tuyến TP HCM – Vũng Tàu với loại xe 16 chỗ chạy tần suất 10-15 phút/chuyến. Xe khách Hoa Mai có chất lượng phục vụ ổn định, thân thiện, và được nhiều hành khách tin dùng để tham quan, du lịch Vũng Tàu, đặc biệt là các kỳ nghỉ, lễ tết. Nhà xe Hoa Mai tin chắc rằng sự tận tâm phục vụ của mình sẽ làm hài lòng mọi quý khách. thu gọn', '', 1407314803, 1409286065, 0, 1, 13),
(29, 'Nam Phương', 'nam-phuong', 'Nam Phương', 'nam-phuong', '269 Phạm Ngũ Lão, Quận 1, Hồ Chi Minh', '269 Pham Ngu Lao St, Dist 1, HCMC', '08. 39209868', 'Nam Phương Travel là thành viên của Nam Phương Group, được thành lập và hoạt động từ năm 2012. Sau một năm hoạt động, chúng tôi đã liên tục tăng số lượng đầu xe cùng với đội ngũ lái xe được tuyển chọn và đào tạo nghiệp vụ đã nhanh chóng đưa Nam Phương Travel trở thành thương hiệu mạnh trên tuyến đường Nha Trang – TP. Hồ Chí Minh.\r\n\r\nXin cảm ơn quý khách đã lựa chọn dịch vụ của Nam Phương Travel. Quý khách là những người đã lựa chọn và giúp Nam Phương Travel trở thành thương hiệu được ưa chuộng nhất trên cung đường Nha Trang – TP. Hồ Chí Minh. Đây là niềm vinh dự và là sự động viên lớn lao để chúng tôi tiếp tục nỗ lực hết sức phục vụ Quý khách ngày càng tốt hơn.\r\n\r\nHiện nay, các dịch vụ mà chúng tôi đang cung cấp trên tuyến đường Nha Trang – Hồ Chí Minh gồm có:\r\n\r\nVận chuyển khách\r\nVận chuyển hàng hóa\r\nChuyển tiền nhanh\r\nDu lịch lữ hành nội địa và quốc tế', 'Nam Phương Travel là thành viên của Nam Phương Group, được thành lập và hoạt động từ năm 2012. Sau một năm hoạt động, chúng tôi đã liên tục tăng số lượng đầu xe cùng với đội ngũ lái xe được tuyển chọn và đào tạo nghiệp vụ đã nhanh chóng đưa Nam Phương Travel trở thành thương hiệu mạnh trên tuyến đường Nha Trang – TP. Hồ Chí Minh.\r\n\r\nXin cảm ơn quý khách đã lựa chọn dịch vụ của Nam Phương Travel. Quý khách là những người đã lựa chọn và giúp Nam Phương Travel trở thành thương hiệu được ưa chuộng nhất trên cung đường Nha Trang – TP. Hồ Chí Minh. Đây là niềm vinh dự và là sự động viên lớn lao để chúng tôi tiếp tục nỗ lực hết sức phục vụ Quý khách ngày càng tốt hơn.\r\n\r\nHiện nay, các dịch vụ mà chúng tôi đang cung cấp trên tuyến đường Nha Trang – Hồ Chí Minh gồm có:\r\n\r\nVận chuyển khách\r\nVận chuyển hàng hóa\r\nChuyển tiền nhanh\r\nDu lịch lữ hành nội địa và quốc tế', 'upload/images/nha-xe/Screen%20Shot%202014-08-06%20at%203_58_23%20PM.png', 1407315564, 1409285951, 1, 1, 13),
(30, 'Minh Tâm', 'minh-tam', 'Minh Tâm', 'minh-tam', '204C Sư Vạn Hạnh,Phường 9, Quận 5, Hồ Chí Minh', '204C Su Van Hanh St, Ward 9, Dist 5, HCMC', '38 30 61 06', 'Từ khi thành lập cho đến nay Công ty TNHH Minh Tâm với thế mạnh vận chuyển hành khách và hàng hóa theo tuyến đường Sài Gòn  ⇔  Bến Tre. Do đó để đáp ứng nhu cầu ngày càng cao của quý khách, công ty chúng tôi đang từng bước phát triển từ phương thức quản lý đến công tác trang bị và đang đa dạng hóa phương tiện vận chuyển. Với kiểu dáng đẹp, hiện đại, sang trọng, rộng rãi và thoáng mát, từ 7 chỗ đến 29 chổ, phù hợp với nhu cầu đa dạng của khách hàng. Với 3 gam màu chủ đạo trắng, xanh, đỏ xen kẻ nhau sẽ tạo cảm giác an toàn, thoải mái trên suốt chặng đường.\r\nVới giá  cả vận chuyển hàng hóa hợp lý, ổn định, uy tín thì Minh Tâm sẽ là nơi đáng được quý khách đặt trọn niềm tin.\r\nMinh Tâm hoạt động dựa trên phương châm "Sự hài lòng của quý khách là thành công của Minh Tâm” cho nên chúng tôi không ngừng học hỏi kinh nghiệm, đổi mới công tác quản lý nhằm đem đến cho khách hàng một dịch vụ tốt nhất. Đội ngũ nhân viên đông đảo, giàu kinh nghiệm, phong cách phục vụ nhiệt tình, chu đáo, thân thiện.', 'Từ khi thành lập cho đến nay Công ty TNHH Minh Tâm với thế mạnh vận chuyển hành khách và hàng hóa theo tuyến đường Sài Gòn  ⇔  Bến Tre. Do đó để đáp ứng nhu cầu ngày càng cao của quý khách, công ty chúng tôi đang từng bước phát triển từ phương thức quản lý đến công tác trang bị và đang đa dạng hóa phương tiện vận chuyển. Với kiểu dáng đẹp, hiện đại, sang trọng, rộng rãi và thoáng mát, từ 7 chỗ đến 29 chổ, phù hợp với nhu cầu đa dạng của khách hàng. Với 3 gam màu chủ đạo trắng, xanh, đỏ xen kẻ nhau sẽ tạo cảm giác an toàn, thoải mái trên suốt chặng đường.\r\nVới giá  cả vận chuyển hàng hóa hợp lý, ổn định, uy tín thì Minh Tâm sẽ là nơi đáng được quý khách đặt trọn niềm tin.\r\nMinh Tâm hoạt động dựa trên phương châm "Sự hài lòng của quý khách là thành công của Minh Tâm” cho nên chúng tôi không ngừng học hỏi kinh nghiệm, đổi mới công tác quản lý nhằm đem đến cho khách hàng một dịch vụ tốt nhất. Đội ngũ nhân viên đông đảo, giàu kinh nghiệm, phong cách phục vụ nhiệt tình, chu đáo, thân thiện.', 'upload/images/nha-xe/Screen%20Shot%202014-08-06%20at%204_04_03%20PM.png', 1407315882, 1409201374, 0, 1, 13),
(31, 'Thịnh Phát', 'thinh-phat', 'Thịnh Phát', 'thinh-phat', '25A Sư Vạn Hạnh, Phường 9, Quận 5, Thành Phố Hồ Chí Minh', '25A Su Van Hanh, Ward 9, Dict 5, Ho Chi Minh City', '(08) 3830.30.42', 'Công ty TNHH TM DV Thịnh Phát được thành lập vào ngày 23 tháng 03 năm 2004,  là một công ty chuyên vận tải hành khách và vận chuyển hàng hóa tuyến đường Thành Phố Hồ Chí Minh – Bến Tre và Thành Phố Hồ Chí Minh – Tiền Giang.\r\n\r\nKhởi đầu từ một doanh nghiệp nhỏ với số lượng xe ít, Công ty TNHH TM DV Thịnh Phát đã từng bước phát triển, tăng cường số lượng xe cũng như tổ chức nhiều giờ chạy hơn để có thể đáp ứng nhu cầu của khách hàng, nhằm cung cấp cho khách hàng phương tiện vận chuyển nhanh nhất.\r\n\r\nVới đội ngũ xe Hyundai County và SAMCO đời mới, Công ty TNHH TM DV Thịnh Phát luôn đảm bảo chất lượng xe tốt nhất để tạo sự thoải mái cho khách hàng.  \r\n\r\nHiện tại, Công Ty đã trang bị 100% thiết bị giám sát hành trình trên các xe để có thể theo dõi lộ trình và tốc độ lái xe nhằm đảm bảo sự an toàn cho khách hàng trên suốt hành trình.\r\n\r\nBên cạnh vận chuyển hành khách, Công ty TNHH TM DV Thịnh Phát còn cung cấp dịch vụ vận chuyển hàng hóa theo tiêu chí vận chuyển hàng hóa nhanh nhất, an toàn', 'Công ty TNHH TM DV Thịnh Phát được thành lập vào ngày 23 tháng 03 năm 2004,  là một công ty chuyên vận tải hành khách và vận chuyển hàng hóa tuyến đường Thành Phố Hồ Chí Minh – Bến Tre và Thành Phố Hồ Chí Minh – Tiền Giang.\r\n\r\nKhởi đầu từ một doanh nghiệp nhỏ với số lượng xe ít, Công ty TNHH TM DV Thịnh Phát đã từng bước phát triển, tăng cường số lượng xe cũng như tổ chức nhiều giờ chạy hơn để có thể đáp ứng nhu cầu của khách hàng, nhằm cung cấp cho khách hàng phương tiện vận chuyển nhanh nhất.\r\n\r\nVới đội ngũ xe Hyundai County và SAMCO đời mới, Công ty TNHH TM DV Thịnh Phát luôn đảm bảo chất lượng xe tốt nhất để tạo sự thoải mái cho khách hàng.  \r\n\r\nHiện tại, Công Ty đã trang bị 100% thiết bị giám sát hành trình trên các xe để có thể theo dõi lộ trình và tốc độ lái xe nhằm đảm bảo sự an toàn cho khách hàng trên suốt hành trình.\r\n\r\nBên cạnh vận chuyển hành khách, Công ty TNHH TM DV Thịnh Phát còn cung cấp dịch vụ vận chuyển hàng hóa theo tiêu chí vận chuyển hàng hóa nhanh nhất, an toàn', 'upload/images/nha-xe/Screen%20Shot%202014-08-07%20at%209_53_03%20AM.png', 1407380089, 1409285923, 0, 1, 13),
(32, 'Hoa Mai', 'hoa-mai', 'Hoa Mai', 'hoa-mai', 'Nguyễn Thái Bình - Quận 1', 'Nguyen Thai Binh St, dist 1, HCMC', '08 6650 3399', 'Hãng xe khách Minh Thắng là một trong những nhà cung cấp dịch vụ trung chuyển hành khách hàng đầu trên tuyến đường Biên Hoà – Buôn Ma Thuột (Đắk Lắk). Nhà xe Minh Thắng hân hạnh đem đến cho quý hành khách một dịch vụ đi lại cao cấp với đoàn xe giường nằm chất lượng cao cùng đội ngũ phục vụ viên nhiệt tình và chuyên nghiệp, đảm bảo cho quý hành khách có những trải nghiệm tuyệt vời trên suốt cả hành trình. Hãng xe Minh Thắng rất mong được phục vụ quý khách!', 'Thương hiệu hãng xe Hoa Mai hiện đã trở nên rất quen thuộc với hành khách trên tuyến TP HCM – Vũng Tàu với loại xe 16 chỗ chạy tần suất 10-15 phút/chuyến. Xe khách Hoa Mai có chất lượng phục vụ ổn định, thân thiện, và được nhiều hành khách tin dùng để tham quan, du lịch Vũng Tàu, đặc biệt là các kỳ nghỉ, lễ tết. Nhà xe Hoa Mai tin chắc rằng sự tận tâm phục vụ của mình sẽ làm hài lòng mọi quý khách', '', 1408000517, 1409286225, 0, 1, 13),
(33, 'Chín Nghĩa', 'chin-nghia', 'Chin Nghia', 'chin-nghia', '6 Hà Huy Tập, Phường Nghĩa Chánh, Quảng Ngãi, Tỉnh Quảng Ngãi', '6 Ha Huy Tap St, Nghia Chanh Ward, Quang Ngai City, Quang Ngai Province', '08 6650 3399', 'Nhà xe Chín Nghĩa nổi tiếng Quảng Ngãi với sự phục vụ tận tình của những nhân viên tâm huyết .Dựa trên phương châm “TẤT CẢ VÌ KHÁCH HÀNG”, hãng xe khách Chín Nghĩa đã được hàng triệu hành khách bình chọn là thương hiệu ưa chuộng nhất Việt Nam và nhà xe Chín Nghĩa đã nhiều lần liên tiếp đạt được giải thưởng Sao Vàng Đất Việt. Đây cũng là vinh dự và nguồn động viên to lớn để xe giường nằm cao cấp Chín Nghĩa tiếp tục nỗ lực hết mình nhằm phục vụ khách hàng tốt hơn. Chín Nghĩa liên tục duy tu, sữa chữa, và nâng cấp dòng xe chất lượng cao, xe giường nằm với mong muốn khách hàng ngày càng được sử dụng những dịch vụ chu đáo hơn. Xe khách Chín Nghĩa cũng luôn sẵn sàng tiếp nhận và đón nhận góp ý của khách hàng', 'Nhà xe Chín Nghĩa nổi tiếng Quảng Ngãi với sự phục vụ tận tình của những nhân viên tâm huyết .Dựa trên phương châm “TẤT CẢ VÌ KHÁCH HÀNG”, hãng xe khách Chín Nghĩa đã được hàng triệu hành khách bình chọn là thương hiệu ưa chuộng nhất Việt Nam và nhà xe Chín Nghĩa đã nhiều lần liên tiếp đạt được giải thưởng Sao Vàng Đất Việt. Đây cũng là vinh dự và nguồn động viên to lớn để xe giường nằm cao cấp Chín Nghĩa tiếp tục nỗ lực hết mình nhằm phục vụ khách hàng tốt hơn. Chín Nghĩa liên tục duy tu, sữa chữa, và nâng cấp dòng xe chất lượng cao, xe giường nằm với mong muốn khách hàng ngày càng được sử dụng những dịch vụ chu đáo hơn. Xe khách Chín Nghĩa cũng luôn sẵn sàng tiếp nhận và đón nhận góp ý của khách hàng', 'upload/images/nha-xe/Untitled-1.png', 1408600455, 1409713116, 0, 1, 13),
(34, 'Phú Vĩnh Long', 'phu-vinh-long', 'Phu Vinh Long', 'phu-vinh-long', '572 Đường 3/2, P.14,Quận 10, TP.Hồ Chí Minh', '572 3/2 St, Ward 14, Dist 10, HCMC', '08 6650 3399', 'Nhờ vào số lượng tuyến xe đa dạng và phong phú, nhà xe Phú Vĩnh Long luôn là sự lựa chọn quen thuộc cho những hành khách có nhu cầu đi lại về miền Tây. Với trung bình 16 chuyến xe mỗi ngày từ Sài Gòn đi Bình Minh, Trà Ôn, Vĩnh Long, và Sa Đéc quý khách sẽ có thể sử dụng dịch vụ của hãng xe khách Phú Vĩnh Long hầu như mọi lúc trong ngày khiến cho quý khách thêm thoải mái trong việc lựa chọn giờ khởi hành. Hãng xe Phú Vĩnh Long luôn đặt sự an toàn của khách hàng lên hàng đầu và nỗ lực không ngừng đổi mới.', 'Nhờ vào số lượng tuyến xe đa dạng và phong phú, nhà xe Phú Vĩnh Long luôn là sự lựa chọn quen thuộc cho những hành khách có nhu cầu đi lại về miền Tây. Với trung bình 16 chuyến xe mỗi ngày từ Sài Gòn đi Bình Minh, Trà Ôn, Vĩnh Long, và Sa Đéc quý khách sẽ có thể sử dụng dịch vụ của hãng xe khách Phú Vĩnh Long hầu như mọi lúc trong ngày khiến cho quý khách thêm thoải mái trong việc lựa chọn giờ khởi hành. Hãng xe Phú Vĩnh Long luôn đặt sự an toàn của khách hàng lên hàng đầu và nỗ lực không ngừng đổi mới.', '', 1409716368, 1409720698, 0, 1, 13);
