INSERT INTO `page` (`page_id`, `page_title_vi`, `page_title_en`, `content_vi`, `content_en`, `status`, `tinh_id`) VALUES
(1, 'Bà Rịa - Vũng Tàu', 'Ba Ria - Vung Tau', 'Vung Tau is the tourist and commercial center of B&agrave; Rịa - Vũng T&agrave;u (an industrial province in Southeastern Vietnam). The whole city area lies on a peninsula which is separated from the mainland by a gulf river called Co May river.<br />\r\n&nbsp;<br />\r\nLocated in Southern Vietnam, Vũng T&agrave;u has only two seasons in a year :<br />\r\nDry season (November - April) : dry&nbsp;and slightly cooler during winter months and around Tết Holiday. Gets hotter in April.<br />\r\n&nbsp;<br />\r\nRainy season (May -&nbsp;October) : rainy, but less than Ho Chi Minh City. Usually hot at noon till 3PM. Summer is&nbsp;ideal for sea bathing.<br />\r\n&nbsp;<br />\r\nH&igrave;nh ảnh:<br />\r\n<br />\r\n<img alt="" src="../upload/images/Untitled.png" style="width: 500px; height: 300px;" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n', 'Vung Tau is the tourist and commercial center of B&agrave; Rịa - Vũng T&agrave;u (an industrial province in Southeastern Vietnam). The whole city area lies on a peninsula which is separated from the mainland by a gulf river called Co May river.<br />\r\n&nbsp;<br />\r\nLocated in Southern Vietnam, Vũng T&agrave;u has only two seasons in a year :<br />\r\nDry season (November - April) : dry&nbsp;and slightly cooler during winter months and around Tết Holiday. Gets hotter in April.<br />\r\n&nbsp;<br />\r\nRainy season (May -&nbsp;October) : rainy, but less than Ho Chi Minh City. Usually hot at noon till 3PM. Summer is&nbsp;ideal for sea bathing.<br />\r\n&nbsp;<br />\r\nH&igrave;nh ảnh:<br />\r\n<br />\r\n<img alt="" src="../upload/images/Untitled.png" style="width: 500px; height: 300px;" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, 3),
(3, 'Đà Nẵng', 'Da Nang', 'Da Nang (Đ&agrave; Nẵng) is Vietnam&#39;s third largest city, and is located on the Eastern Sea coast, midway between Hanoi and Ho Chi Minh City and the largest city of Central Vietnam.<br />\r\n&nbsp;<br />\r\nThe city itself has neither the atmosphere of Hanoi nor the hustle-bustle of Ho Chi Minh City, but has its share of sights and is close to the charms of Hoi An and the imperial capital of Hue, making it a popular vacationing spot for those looking to explore the attractions of central Vietnam or soak up some rays while hanging out on the city&#39;s beaches.<br />\r\n&nbsp;<br />\r\nThe hottest months of the year are June, July, and August, when the temperature can get to as high as 40 degrees Celsius, and it is generally very dry. There are usually tropical storms in October and November.<br />\r\n&nbsp;<img alt="" src="../upload/images/dan.png" style="width: 1600px; height: 1002px;" />', 'Da Nang (Đ&agrave; Nẵng) is Vietnam&#39;s third largest city, and is located on the Eastern Sea coast, midway between Hanoi and Ho Chi Minh City and the largest city of Central Vietnam.<br />\r\n&nbsp;<br />\r\nThe city itself has neither the atmosphere of Hanoi nor the hustle-bustle of Ho Chi Minh City, but has its share of sights and is close to the charms of Hoi An and the imperial capital of Hue, making it a popular vacationing spot for those looking to explore the attractions of central Vietnam or soak up some rays while hanging out on the city&#39;s beaches.<br />\r\n&nbsp;<br />\r\nThe hottest months of the year are June, July, and August, when the temperature can get to as high as 40 degrees Celsius, and it is generally very dry. There are usually tropical storms in October and November.<br />\r\n&nbsp;<img alt="" src="../upload/images/dan.png" style="width: 1600px; height: 1002px;" />', 1, 7);
